// src/pages/AboutContactPage.jsx
import React from "react";
import "../styles/AboutContactPage.css";

function AboutContactPage() {
  return (
    <div className="about-contact-page">
      <section className="about-section">
        <h2>About Cold Company</h2>
        <p>
          Welcome to Cold Company! We specialize in high-quality air conditioning,
          refrigeration, and appliance parts. Our goal is to provide reliable products
          and outstanding customer service.
        </p>
      </section>

      <section className="contact-section">
        <h2>Contact Us</h2>
        <p>
          <strong>Email:</strong> info@coldcompany.com
        </p>
        <p>
          <strong>Phone:</strong> +27 12 345 6789
        </p>
        <p>
          <strong>Address:</strong> 123 Cold Street, Pretoria, South Africa
        </p>
      </section>
    </div>
  );
}

export default AboutContactPage;
